import React from "react";
import styled from "styled-components";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import resim4 from "../Assets/image1.jpg";

const StyledImageDiv = styled.div`
  background: url(${resim4});
  background-size: cover;
  background-position: left top;
  background-repeat: no-repeat;
`;

export default function ProjectCard() {
  return (
    <div className="project-card">
      <div className="project-card-image">
        <StyledImageDiv className="styled-image-div" />
      </div>
      <div className="project-card-content">
        <span className="project-card-content-title">Workintech</span>
        <p className="project-card-content-description">
          A simple, customizable, minimal setup cookie plugin that allows your
          users to select which cookies to accept or decline. This was created
          with vanilla JS, SCSS and Parcel Bundler and is available as a NPM
          package and the git repository makes any type of customization to code
          and themes possible.
        </p>
        <div className="project-card-content-techs mb-3">
          <ul className="flex flex-row gap-2">
            <li>react</li>
            <li>react</li>
            <li>react</li>
          </ul>
        </div>
        <div className="project-card-content-links gap-4">
          <span>View Site</span>
          <span>Github</span>
        </div>
      </div>
    </div>
  );
}
